export default class extends React.Component {
    render() {
        return (
            <div className='contenedor'>
                <p>Login</p>
                <style jsx>{`
                    .contenedor{
                        box-sizing: border-box;
                        height:100%;
                        display: flex;
                        flex-direction: column;
                    }

                    p{
                        width: 100%
                        height:100%;
                        background: #000;
                    }
                `}</style>
            </div>
        );
    }
}
